//   ___  ___  ___  ___  ___        ___  _     ___ __   __  _   
//  | _ \| _ \| __|/ __|/ __|      | _ \| |   /   \\ \ / / | |  
//  |  _/|   /| _| \__ \\__ \      |  _/| |__ | - | \   /  |_|  
//  |_|  |_|_\|___||___/|___/      |_|  |____||_|_|  |_|   (_)  

const e = createEngine(gameCanvas, 300, 300);

e.addText("Can you make a staircase", 130, 24);
e.addText("up to the trophy?", 130, 24 + 16);
e.addText("---->", 130, 24 + 16*2);


/* BEGIN STAIRCASE */
for (let i = 0; i < 2; i++) {
  e.add({
    sprite: tile,
    solid: true,
    scale: 2,
    x: 64 * i,
    y: 236,
  })
}
/* END STAIRCASE */

/* BEGIN KNIGHT */
let jumps = 1;
e.add({
  sprite: knight,
  solid: true,
  scale: 3,
  collides: (me, them) => {
    jumps = 1;
  },
  update: (me) => {
    me.vy += 10;

    if (e.pressedKey(" ") && jumps === 1) {
      jumps = 0;
      me.vy -= 220;
    }

    if (e.heldKey("ArrowRight")) {
      me.x += 2;
    }

    if (e.heldKey("ArrowLeft")) {
      me.x -= 2;
    }
  }
})
/* END KNIGHT */

/* BEGIN CUP */
e.add({ sprite: cup, x: 237, y: 15, scale: 3, collides: e.remove.bind(e) });
/* END CUP */

e.start();
